        <style type="text/css">
          body {
            background: #222;
            color: #fff;
          }

          img {
            width: 100%;
          }


          .caption, .upvote, .downvote {
            text-align: center;
            padding: 3px;
            border: 1px solid #555;
          }

          .dropdown {
            margin-right: 10px;
          }

          .dropdown select {
            min-width: 100px;
            cursor: pointer;
          }

          label {
            width: 80px;
            display: inline-block;
          }

          a {
            color: #fff;
            text-decoration: none;
          }

          .vote {
            display: flex;
          }

          .vote > * {
            flex: 1;
            text-align: center;
            padding: 1px;
            cursor: pointer;
            color: hsl(0deg 4% 84%);
          }



          .active {
            background-color: #000;
            border-color: #fff;
          }

          main {
            display: grid;
            column-gap: 1.5em;
            row-gap: 1.5em;
            grid-template-columns: 1fr 1fr 1fr 1fr 1fr;
          }

          footer {
            margin: 2em;
            display: flex;
            justify-content: center;
          }

          textarea {
            height: 8em;
            width: 45em;
            background-color: hsl(0deg 4% 84%);
          }

          .metadata {
            max-width: 200px;
            width: 100%;
          }

          .metadata-output {
            height: 500px;
          }

          @media (max-width: 1200px) {
            main {
              grid-template-columns: 1fr 1fr 1fr 1fr;
            }
          }

          @media (max-width: 1000px) {
            main {
              grid-template-columns: 1fr 1fr 1fr;
            }
          }

          @media (max-width: 600px) {
            main {
              grid-template-columns: 1fr 1fr;
            }
          }

          @media (max-width: 450px) {
            main {
              grid-template-columns: 1fr;
            }
          }

        </style>
